    const [hotels,setHotels]=useState([]);
    useEffect(()=>{
        (async ()=>{
            try{
                const {data}=await axios.get(
                    "https://travel-app-backend-five.vercel.app/api/hotels"
                )
                console.log(data);
            }catch(err){
                console.log(err)
            }
        })()
    },[])
    return(
        <>
            <Navbar />
            <main className="main">
                <HotelCard />
            </main>
           
        </>
       
    )
}
